import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// Import your components
import Login from './Login.jsx';
import UserDashboard from './UserDashboard.jsx';
import ProviderDashboard from './ProviderDashboard.jsx';

// This is the main application component that sets up the routing
const App = () => {
    return (
        <Router>
            <Routes>
                {/* Route for the login page. This will be the landing page. */}
                <Route path="/" element={<Login />} />

                {/* Route for the user dashboard. */}
                <Route path="/user" element={<UserDashboard />} />

                {/* Route for the provider dashboard. */}
                <Route path="/provider" element={<ProviderDashboard />} />

                {/* A fallback route for any unknown paths, which redirects to the login page. */}
                <Route path="*" element={<Navigate to="/" />} />
            </Routes>
        </Router>
    );
};

export default App;
